var score = 0;
var best = 0;

const startGame = () => {
  getCard();
}

const makeChoice = (myChoice) => {
  const card = $('#card-name').text();
  const correctAnswer = realCardNames.indexOf(card) > -1 ? true : false;
  if (myChoice == correctAnswer) {
    score += 1;
    if (score > best) {
      best = score;
    }
  } else {
    score = 0;
  }
  getCard();
}

const getCard = () => {
  var card = 'Blank';
  var r = Math.round(Math.random());

  if(r == 1) {
    card = realCardNames[Math.floor(Math.random()*realCardNames.length)];
  } else {
    card = makeUpACardName();
    while (realCardNames.indexOf(card) > -1) {
      card = makeUpACardName();
    }
  }

  $('#card-name').text(card);
  $('#score').text(score);
  $('#best').text(best);
}

const makeUpACardName = () => {
  var length = Math.round(Math.random()*3) + 1;
  var name = '';

  for (var i = 0; i < length; i++) {
    if (i == 0) {
      name += cardNameStarters[Math.floor(Math.random()*cardNameStarters.length)];
    } else {
      if (i == 1) {
        var a = [' ',' ',' of ',' of the ',' ',' from ',' the ',', ',': ',' - '];
        name += a[Math.floor(Math.random()*a.length)] + cardNameStarters[Math.floor(Math.random()*cardNameStarters.length)];
      } else {
        name += ' ' + cardNameStarters[Math.floor(Math.random()*cardNameStarters.length)];
      }
    }
  }

  return name;
}

getCard();
